const LOGIN = "LOGIN";

const InitialState = [
    {
        user: 'admin',
        password: 12345,
    }
];

const loginReducer = (state = InitialState ,action) => {
    return (
        state
    )
};

export const sendUserCreator = () => ({type: LOGIN});
export default loginReducer;
